import { Heading, Pane } from 'evergreen-ui'
import React from 'react';

type PageProps = {
    name?: string
    children: any
}


export default function Page({ name, children }: PageProps) {

    return (
        <>
        <Heading>{name}</Heading>

        <Pane
            width={1600}
            margin={24}
            display="flex"
            justifyContent="center"
            alignItems="center"
            flexDirection="column"
            marginLeft="auto"
            marginRight="auto">
                {children}
        </Pane>
        </>
    );

}
